Mondays at 1:00PM EST &#xD;
&#xD;
Eat Your Words is the weekly radio dispatch from Cathy Erway, founder of the blog Not Eating Out In New York. Every week, Cathy is joined by authors of books that you just want to eat up -- from colorful cookbooks to food memoirs to exposes on the food industry, it's all meaty topic for discussion. Tune in to learn what's new and happening in the world of food through its literature.&#xD;
&#xD;
&#xD;
For more, visit Cathy's blog: www.NotEatingOutinNY.com&#xD;
&#xD;
&#xD;
Cathy Erway is the author of The Art of Eating In: How I Learned to Stop Spending and Love the Stove, which USA Today hailed, &#x201C;deserves a toast.&#x201D; It was based on her two years of going without restaurant food and her popular blog on that topic, Not Eating Out In New York. A freelance writer, part-time cook and full-time dabbler, Cathy has received numerous honors, including being chosen in the &#x201C;Top 50 Food Blogs in the World&#x201D; by the Times UK in 2009, being named one of the &#x201C;Top 10 Most Eccentric Food Personalities&#x201D; by Eater in 2010, and being featured as the &#x201C;Healthy Habits Hero&#x201D; of the month in Cooking Light in 2013.&#xD;
&#xD;
Guest Hosts&#xD;
&#xD;
Talia Ralph is a journalist, semi-professional eater, and masters candidate in Food Studies at NYU. When not guest-hosting "Eat Your Words," she reports for Heritage Radio Network's homepage and VICE Food and is a Julia Child Food Writing Fellow for Food52. She is also the editor-in-chief and co-founder of non-fiction magazine The Landing, and has a food zine in the works. For more, check out her website and blog. &#xD;
&#xD;
Briana Kurtz hails from Charleston, S.C. She comes to food by way of the wine industry, which she has been involved in for the past decade. She has an international affairs and project management background including having worked for the U.S. Department of State in Washington, D.C. from 2008-2011. In addition to co-hosting Eat Your Words she writes for Heritage Radio Network's homepage. She is also a certified Fuse Pilates instructor and soon to be 200-hour Laughing Lotus certified yoga instructor. She will pursue her M.A. in Food Studies at NYU beginning in September of 2014. &#xD;
&#xD;
Heritage Radio Network. All Rights Reserved.

Sundays at 6:00PM EST &#xD;
&#xD;
Tune in to Eating Disorder - Sundays at 6pm on Heritage Radio Network. Each week Chef Paul Gerard, The Rev Spyro and Crazy Legs Conti will be taking shots and poking fun at some of the most bizarre, amusing and ridiculous trends to hit the culinary world, along with a revolving door of special guests. Twitter: @forkyouradio.&#xD;
&#xD;
&#xD;
Chef Paul Gerard&#xD;
&#xD;
Writer, rock &amp;amp; roller, and now renowned chef, Paul Gerard has been around the world fueled by love for good food and adventure. Paul got his start at 13 in Brooklyn working in restaurants as a busboy until his hair got too long and he was moved to the kitchen. Gerard&#x2019;s desire to discover a life outside New York took him to New Orleans, where for 13 lucky years he honed his skills under some of the greats before moving on for a life on the road and finally returning to NYC to open up Exchange Alley in Manhattan&#x2019;s East Village.&#xD;
&#xD;
The Rev Spyro&#xD;
The Rev Spyro started his media career at infamous Silicon Alley start-up Pseudo.com under the mentorship of media Svengali Joshua M. Harris. You can read about his exploits in the new book Totally Wired: The Wild Rise and Crazy Fall of the First Dotcom Dream. He has since worked at worked at entertainment media outlets such as; New Times Media, PAPER Magazine and also written articles for Flavorwire.com, 11211 Magazine and The NY Press. In his off time he plays bass for rock band Girl To Gorilla and his love for food is so deep he has a sacred heart crossed with a knife and fork tattooed over his stomach.&#xD;
&#xD;
Crazy Legs Conti&#xD;
Crazy Legs Conti has been a competitive eater with Major League Eating for 13 years and held jobs as a beverage manager of strip clubs, a short order cook, and a nude male model.  He is a star of a documentary - Zen and the Art of Competitive Eating, a video game avatar and has been on "The Sopranos", "Letterman", and "The View" His favorite pasta shape is cavatelli.&#xD;

