Enka del Rio ha trabajado y recorrido todo el pa&#237;s con sus locales, fiestas y discotecas de todo tipo de p&#250;blico. Ha sido residente de las mejores salas del pa&#237;s y ha actuado con los m&#225;s grandes. Algunos de sus SETS m&#225;s famosos podr&#237;an ser: Star Dreams, chikita valles, as de copes, aSac, Salome, Lou, &#192;tic, Louie Vega, Quo Vadis, Carpas de Roda, NoovoClub, Global, La Costa, Kopai, Arenas, Utopia.. Colaborando con fiestas New Fetish y BolloAnddbutter.
Adem&#225;s de ser la deejay oficial del World Tour de Grupo Kamikaze, en su gira 2011, 2012 de gira por todo el pa&#237;s realizando macro fiestas, festivales y muchos eventos para todo tipo de p&#250;blico junto al equipo art&#237;stico
Enka del Rio lleva muchos a&#241;os de carrera profesional, compartiendo cabinas con los deejays mas reconocidos a nivel nacional como son: Sof&#237;a Deejay, Lydia Sanz, Victor Magan, Vida Loca, Jose AM, Alex de Guirior, Borja Delanera, Iordee entre muchos m&#225;s&#8230;

