The Epic Questions Podcast will bring together different perspectives and opinions on various topics within the World of Warcraft.  No topic or question related to WoW will be off limits.  Your host Epicinsanity is your average everyday player and is not a hard-core gamer.  Just a regular everyday person who has something to say about the World of Warcraft&#13;
 &#13;
Our goal is to provide a short cast in a free flow format where we sit around and simply talk about the game we love.  We will have the occasional guest who is also a regular everyday WoW player.  We gather our questions from readers and viewers like you.  We are a listener directed cast and want to know what you want us to talk about. &#13;
&#13;
So, hop into the drivers seat and send us your questions!!

This LIVE radio program with video simulcast is the creation of journalist and equal rights advocate Randol White, and features the very latest news, trends, and opinions affecting the LGBT community. It's live format allows for up-to-the-minute conversations with the day's news makers, as well as audience interaction via phone (42-42-RANDOL), Twitter, Facebook, email, and the QTalk America Chat Room. In addition to news and opinions, the program also highlights weekly health and leisure topics.&#xD;
&#xD;
Listen / watch Equality Radio LIVE weekdays at 3pm Pacific, exclusively on QTalk America.

