Hello! Jake and I (Greg) work at a comic shop in Washington and when you work in comics you tend to have a lot to say about the world you live in. So you wanna know what this is all about. Well to put it simply this is a place where we talk about everything and nothing's held back. We can go from the new Marvel movie to gay rights in nothing short of a second. &#xD;
We will be posting multiple podcasts a week&#xD;
Including; "Wednesday Bagcast" where Jake and I talk about the comics as we bag and board them for the shop, also a weekly podcast about nerd happenings (Magic: the Gathering, Movies, TV shows, and such things) and we will have special guests on from time to time. So stay tuned!!

