Focus on Extreme Metal is a bi-weekly show focusing on all things dark, brutal and extreme.&#xD; 
This fast paced show features ton of music, captivating discussion, interviews, latest news headlines, reviews of the latest releases and plenty of segments from contributing metalheads.&#xD; 
Join the Extreme Pair of Dario Sycco and Mandy Delamuerte as they dive deep into the dark, complex and technical aspects of death, black, grind and generally extreme forms of metal. Expect the unexpected with offbeat humor and hot, intelligent and explicit nature of this show. Focus on Extreme Metal is not for the faint of heart, only for those who enjoy the darkest, heaviest, fastest and least conventional side of metal.
